/**
 * Returns the most repeated element in an array
 *
 * @example
 * mode([1, 2, 2, 3, 4]); // 2
 * mode(["apple", "banana", "banana", "cherry"]); // "banana"
 *
 * @param  {Array} args - the elements to get the mode
 * @returns {*}
 *
 * @function mode
 * @memberof Maths
 */
export function mode(...args: any[]): any;
